import React, { useEffect, useState } from "react";
import Navbar from "../../components/Navbar";
import axios from "axios";
import Cards from "../../components/Cards";
import { NavLink } from "react-router-dom";
import NextPages from "../../components/NextPages";
import InfiniteScroll from "react-infinite-scroll-component";

const Acceuil = () => {
  const [data, setData] = useState([]);
  const [showPop, setShowPop] = useState(false);
  const [showRate, setShowRate] = useState(false);
  const [showDate, setShowDate] = useState(false);
  const [sortChoice, setChoiceSort] = useState();

  useEffect(() => {
    axios
      .get(
        "https://api.themoviedb.org/3/movie/popular?api_key=864b6602f4018630491e67fa714381e6&language=fr-FR"
      )
      .then((res) => setData(res.data.results));
  }, [data, sortChoice]);

  return (
    <div>
      <Navbar />
      <div className="popular-container">
        <div className="filters">
          <h3>Trier les résultats par</h3>
          <div className="trie-container">
            <div className="drop-container">
              <ul onClick={() => setShowPop(!showPop)}>
                Popularité
                {showPop ? (
                  <div className="drop-menu">
                    <li onClick={() => setChoiceSort(2)}>Popularité +/-</li>
                    <li onClick={() => setChoiceSort(3)}>Popularité -/+</li>
                  </div>
                ) : null}
              </ul>
            </div>
            <div className="drop-container">
              <ul onClick={() => setShowRate(!showRate)}>
                Notation
                {showRate ? (
                  <div className="drop-menu">
                    <li onClick={() => setChoiceSort(0)}>Note +/-</li>
                    <li onClick={() => setChoiceSort(1)}>Note -/+</li>
                  </div>
                ) : null}
              </ul>
            </div>
            <div className="drop-container">
              <ul onClick={() => setShowDate(!showDate)}>
                Dates de sortie
                {showDate ? (
                  <div className="drop-menu">
                    <li onClick={() => setChoiceSort(4)}>Date +/-</li>
                    <li onClick={() => setChoiceSort(5)}>Date -/+</li>
                  </div>
                ) : null}
              </ul>
            </div>
            <p onClick={() => setChoiceSort(6)}>Titres ( de A à Z)</p>
          </div>
        </div>
        <div className="cards-container">
          {data
            .sort((a, b) => {
              if (sortChoice === 0) {
                return b.vote_average - a.vote_average;
              } else if (sortChoice === 1) {
                return a.vote_average - b.vote_average;
              } else if (sortChoice === 2) {
                return b.popularity - a.popularity;
              } else if (sortChoice === 3) {
                return a.popularity - b.popularity;
              } else if (sortChoice === 4) {
                return b.release_date - a.release_date;
              } else if (sortChoice === 5) {
                return a.release_date - b.release_date;
              } else if (sortChoice === 6) {
                return b - a;
              }
            })
            .map((movie) => {
              return (
                <NavLink to={`/${movie.id}`}>
                  <Cards key={movie.id} movie={movie} />
                </NavLink>
              );
            })}

          <InfiniteScroll
            dataLength={items.length} //This is important field to render the next data
            next={fetchData}
            hasMore={true}
            loader={<h4>Loading...</h4>}
            endMessage={
              <p style={{ textAlign: "center" }}>
                <b>Yay! You have seen it all</b>
              </p>
            }
            // below props only if you need pull down functionality
            refreshFunction={this.refresh}
            pullDownToRefresh
            pullDownToRefreshThreshold={50}
            pullDownToRefreshContent={
              <h3 style={{ textAlign: "center" }}>
                &#8595; Pull down to refresh
              </h3>
            }
            releaseToRefreshContent={
              <h3 style={{ textAlign: "center" }}>
                &#8593; Release to refresh
              </h3>
            }
          >
            {items}
          </InfiniteScroll>
        </div>
        <NextPages />
      </div>
    </div>
  );
};

export default Acceuil;
